import React, { useState, useEffect } from 'react';
import LeftCard from './Leftcard';
//import RightCard from './Rightcard';

function Card() {

    const [card, setcard] = useState('');
    useEffect(() => {
        fetch(`https://newsapi.org/v2/top-headlines?sources=bbc-news&apiKey=bb5b1c906cb34c1d90fe13b072449dee`).then(res => {
            console.log('called')
            return res.json()
        }).then(ans => {
            setcard(ans.articles.forEach((item ,index) => {
                    return <LeftCard key={index} heading={item.title} imageUrl={item.urlToImage} para={item.content} />
                   // return <RightCard key={index} heading={item.title} imageUrl={item.urlToImage} para={item.content} />
            }))
        }).catch(err => {
            throw err
        })
    }, [])
    return (
    <React.Fragment>
        <h1 className="news">BBC-NEWS</h1>
        <div class="row">
            {card}
        </div>
    </React.Fragment>
    )
}

export default Card;
